1. THE INFORMATION WE COLLECT
We and our service providers may collect information when you provide information to us and when information is collected automatically.Personal InformationYou may choose to give us personally identifiable information online to allow us to communicate with you, process your orders, or provide you with services.  Our online forms ask for a small amount of relevant information, such as name, company name, email, street address, and phone number.  Some forms may ask for a product serial number.  If you make a purchase or order a repair, we may ask for your credit card number and billing information.  Job applicants may be requested to provide information such as educational background, employment experience, and job interest.The types of personal information Canon U.S.A. may collect from you includes:
Personal and business contact information, such as name, address, phone number, and email address;
 Your friends’ contact information, including email or shipping address, which you may provide to us when you email a link to a product description or your wish list, or when you share our newsletter or deliver our products to a friend; 
 Financial information, such as your credit/debit card number or other billing information;
 Other unique information such as user IDs and passwords, product functionality, product and service preferences, contact preferences, educational and employment background, and job interest data;
 Geo-location data such as your IP address, physical location, and other similar location information collected when you request location based services;
 Details of the products and services you have purchased from us or which you have inquired about, together with any additional information necessary to deliver those products and services and to respond to your inquiries;
 Any additional information relating to you that you provide to us directly through our websites or indirectly through use of our websites or online presence, through our representatives or otherwise; and 
 Information you provide to us through our service center, customer surveys or visits by our representatives from time to time.
Usage InformationIn addition to the information you may provide, Canon U.S.A. may collect information when you access or use the Services or a website "powered by" another company on behalf of Canon U.S.A. through our use of data collection technologies, including web beacons, cookies, and embedded web links.  These technologies collect certain traffic information that your browser sends to a web site, such as your browser type and language, access times, and the address of the web site from which you arrived.  They may also collect information about your Internet Protocol (IP) address, unique device identifier, geolocation information, clickstream behavior (i.e., the pages you view, the links you click, and other actions you take in connection with Canon U.S.A. websites or “powered by" websites) and product information.  Canon U.S.A. may also use some of these technologies in connection with emails and communications sent from Canon U.S.A. and therefore may collect information using these tools when you open the email or click on a link contained in the email.Below is some additional detail on how we use cookies and other technologies:Cookies. Cookies are data files placed on a device when it is used to visit the Service ("Cookies").  We may use Cookies to collect and store certain information about you, for security purposes, to facilitate site navigation and to personalize your experience while visiting our Site.  Cookies can remain in your computer for the duration of a browsing session or for a predetermined period of time.  Cookies that remain in your computer for a predetermined period of time are called "persistent" cookies.  We may use persistent cookies to show you recently-viewed products, provide you with product or service recommendations, or otherwise provide you with a customized experience.If you would prefer not to accept Cookies, most browsers will allow you to:  (i) change your browser settings to notify you when you receive a Cookie, which lets you choose whether or not to accept it; (ii)  disable existing Cookies; or (iii) set your browser to automatically reject any Cookies.Please be aware that if you disable or reject Cookies, some features and services on our Services may not work properly.Other Technologies. We may use standard Internet technology, such as web beacons (also called clear GIFs or pixel tags) and other similar technologies, to track your use of our Services.  We also may include web beacons in e-mail messages, newsletters and advertisements to determine whether messages have been opened and acted upon.  The information we obtain in this manner enables us to customize the Services we offer and measure the overall effectiveness of our online content and the products and services we offer through the Services.IBM Digital Analytics. We use web analytics tools such as IBM Digital Analytics to assist us in understanding how people use our Services and related marketing and promotions.  To manage your preferences with respect to IBM Digital Analytics click here.Collection by Third-Parties. We may allow third-parties, including our authorized service providers, advertising agencies and marketing partners to use tracking technologies, such as cookies and web beacons, to collect non-personal information about your visits to this and other web sites on the Services.  This information generally enables them to track and gauge the effectiveness of our Services and of various marketing campaigns and to serve ads about goods and services that may be of interest to you when you visit other web sites across the Internet.Use of Public Information. Canon U.S.A. also collects information from publicly or commercially available sources that it deems credible.  Such information may include your name, address, email address, preferences, company name, title, specific devices that are financed or leased (UCC), interests, and firmographic or demographic/profile data.  The information Canon U.S.A. collects from its public or commercial sources may be used along with the information Canon U.S.A. collects when you access or use the Services.  For example, Canon U.S.A. may compare the geographic information acquired from publicly available sources with the IP address collected by the technologies discussed above to derive your general geographic area.
